import { Container, Button } from "shards-react";

export default function PatientLogin() {
  return (
    <Container className="bg-white">
      <h4 className="mb-4 ">Login</h4>
      <div>
        <div></div>
        <div></div>
        <div></div>
        <div>
        <Button type="submit">Login</Button>
        </div>
      </div>
    </Container>
  );
};
